import React from 'react';
import { useAuth } from '../context/AuthContext';

const AddForm = ({ book }) => {
    const { addToShelf } = useAuth();

    const handleAddBook = () => {
        addToShelf(book);
    };

    return (
        <div>
            <button onClick={handleAddBook}>Add Book</button>
        </div>
    );
};

export default AddForm;
